const paperStyle = {
    padding: 20,
    height: "70vh",
    width: 280,
    margin: "20px auto",
};
const avatarStyle = {
    backgroundColor: "magenta",
};
const textStyle = {
    margin: "8px 0",
};
const btnStyle = {
    margin: "8px 0",
};

export {
    paperStyle,
    avatarStyle,
    textStyle,
    btnStyle
}
